import React from 'react'
import Books from '../Resource/Books'
import Book  from '../Components/Book'

const books = (props) => {
    const listBooks = Books.map((book) => {
        return (
            <Book title={book.title} />
        )
    })
    return (
        <div>
            <ul>
                { listBooks }
            </ul>
        </div>
    )
}
export default books
